#import "ViewController.h"
#import "CoreText/CTFont.h"
#import <vector>

static NSString *keyAPI = @"YOUR_GOOGLE_API_KEY";

enum EChatMessageSource : uint8_t {
    Normal = 0,
    TribeMate = 1,
    TribeAdmin = 2,
    Admin = 3,
    ARK = 4
};
enum EChatMessageType : uint8_t {
    Text = 0,
    Emote = 1,
    LogIn = 2,
    Notification = 3,
    Announcement = 4
};
enum EChatChannel : uint8_t {
    Local = 0,
    Global = 1,
    Tribe = 2,
    TribeAndAlliance = 3,
    Radio = 4
};
enum TeamType : uint8_t {
    Enemy = 0,
    Tribemate = 1,
    Ally = 2
};


struct TextEntries{
    NSString* PlayerName;
    NSString* TextString;
    EChatMessageSource Source;
    EChatChannel Channel;
    EChatMessageType Type;
    TeamType TeamID;
};
std::vector<TextEntries> entries;
#define AddEntry(PlayerName, TextString, ChatMessageSource, ChatChannel, ChatMessageType, TeamID) entries.push_back({PlayerName, TextString, ChatMessageSource, ChatChannel, ChatMessageType, TeamID})

//Sample chat entries
static void ConstructEntries(){
    AddEntry(@"Enemy Player!",
             @"An enemy is talking in Chat",
             Normal,
             Global,
             Text,
             Enemy);
    AddEntry(@"Tribemate!",
             @"A tribemate said something. Attack this base. ",
             TribeAdmin,
             Tribe,
             Text,
             Tribemate);
    AddEntry(@"Enemy Player!",
             @"This enemy is nearby. Watch out.",
             Normal,
             Local,
             Notification,
             Enemy);
    AddEntry(@"Allied Player",
             @"The player who sent this message is an ally. ",
             Normal,
             TribeAndAlliance,
             Text,
             Ally);
    AddEntry(@"Enemy Player!",
             @"An enemy is talking in Chat again, he is not your friend",
             Normal,
             Global,
             Text,
             Enemy);
    return;
}

float VericalSpacing = 20;
float HorizontalSpacing = 20;
float EntryHeight = 100;
float VerticalHeight = 0;
float ScrollStartHeight = 50;

static UIView *GlobeViews[30];
static UIView *CopyViews[30];
static UILabel *TextLabels[30];

UILabel* CurrentLanguage;
NSString* TranslateToLanguage = @"zh";
NSString *LanguageToTranslateTo;
UIScrollView* view;
UIView* middleView;

static UIViewController* currentTopViewControllerFn() {
    UIViewController *topVC = [[[[UIApplication sharedApplication] delegate] window] rootViewController];
    while (topVC.presentedViewController) {
        topVC = topVC.presentedViewController;
    }
    return topVC;
}

@interface ViewController ()

@end

@implementation ViewController

- (void)viewDidLoad {
    ConstructEntries();
    float Screen_Width = UIScreen.mainScreen.bounds.size.width;
    float Screen_Height = UIScreen.mainScreen.bounds.size.height;
    int EntriesSize =  (int)entries.size();
    
    /* Bear Icon */
    NSString *imageBase64 = @"";
    NSData *imageData = [[NSData alloc] initWithBase64EncodedString:imageBase64 options:NSDataBase64DecodingIgnoreUnknownCharacters];
    UIImage *image = [UIImage imageWithData:imageData];

    
    UIImageView* BackroundView = [[UIImageView alloc] initWithFrame:CGRectMake(0, 0, Screen_Width, Screen_Height)];
    BackroundView.image = image;
    [BackroundView setUserInteractionEnabled:YES];
    
    self.view = BackroundView;
    
    middleView = [[UIView alloc] initWithFrame:CGRectMake(0, 0, Screen_Width, Screen_Height)];
    [middleView setUserInteractionEnabled:YES];
    [middleView setBackgroundColor:[UIColor clearColor]];
    [BackroundView addSubview:middleView];
    
    
    view = [[UIScrollView alloc] initWithFrame:CGRectMake(0, ScrollStartHeight, Screen_Width, Screen_Height)];
    view.contentSize = CGSizeMake(Screen_Width, VerticalHeight + (EntryHeight + VericalSpacing) * EntriesSize);
    [view setBackgroundColor:[UIColor clearColor]];
    [view setUserInteractionEnabled:YES];
    [middleView addSubview:view];
    
    /* Text Layer Stuff*/
    CTFontRef ref = CTFontCreateWithName((CFStringRef)@"Copperplate-Bold", 25, NULL);

    
    
    UIButton* ChangeLanguageButton = [UIButton buttonWithType:UIButtonTypeRoundedRect];
    
    //Choose Language Selector
    [ChangeLanguageButton addTarget:self action:@selector(SelectLanguage)
                   forControlEvents:UIControlEventTouchUpInside];
    [ChangeLanguageButton setTitle:@"Change Language" forState:UIControlStateNormal];
    ChangeLanguageButton.frame = CGRectMake(10, 10, 240.0, 30);
    [ChangeLanguageButton setTitleColor:[UIColor blackColor] forState:UIControlStateNormal];
    ChangeLanguageButton.backgroundColor = [UIColor lightGrayColor];
    ChangeLanguageButton.alpha = .7f;
    ChangeLanguageButton.layer.cornerRadius = 10.f;
    ChangeLanguageButton.titleLabel.font = [UIFont fontWithName:@"Copperplate-Bold" size:18];
    [middleView addSubview:ChangeLanguageButton];
    
    //Current Language Text
    CurrentLanguage = [[UILabel alloc]initWithFrame:CGRectMake(260.f, 10, 150.f, 30)];
    CurrentLanguage.text = @"中文";
    CurrentLanguage.textColor = [UIColor blackColor];
    CurrentLanguage.font = [UIFont fontWithName:@"Copperplate-Bold" size:16];
    CurrentLanguage.shadowColor = [UIColor whiteColor];
    CurrentLanguage.shadowOffset = CGSizeMake(1.5f, 1.5f);
    [middleView addSubview:CurrentLanguage];
    
    //Close Program - add own implimentation
    UIButton* ExitButton = [UIButton buttonWithType:UIButtonTypeRoundedRect];
    [ExitButton addTarget:self action:@selector(HideWindow)
                   forControlEvents:UIControlEventTouchUpInside];
    [ExitButton setTitle:@"Quit" forState:UIControlStateNormal];
    ExitButton.frame = CGRectMake(Screen_Width - 120, 10, 100.0, 30);
    [ExitButton setTitleColor:[UIColor blackColor] forState:UIControlStateNormal];
    ExitButton.backgroundColor = [UIColor lightGrayColor];
    ExitButton.alpha = .7f;
    ExitButton.layer.cornerRadius = 10.f;
    ExitButton.titleLabel.font = [UIFont fontWithName:@"Copperplate-Bold" size:18];
    [middleView addSubview:ExitButton];
    
    //Add button to translate custom text
    UIButton* TranslateButton = [UIButton buttonWithType:UIButtonTypeRoundedRect];
    [TranslateButton addTarget:self action:@selector(TranslateMyText)
                   forControlEvents:UIControlEventTouchUpInside];
    [TranslateButton setTitle:@"Translate" forState:UIControlStateNormal];
    TranslateButton.frame = CGRectMake(Screen_Width - 240, 10, 100.0, 30);
    [TranslateButton setTitleColor:[UIColor blackColor] forState:UIControlStateNormal];
    TranslateButton.backgroundColor = [UIColor lightGrayColor];
    TranslateButton.alpha = .7f;
    TranslateButton.layer.cornerRadius = 10.f;
    TranslateButton.titleLabel.font = [UIFont fontWithName:@"Copperplate-Bold" size:18];
    [middleView addSubview:TranslateButton];
    
    /* Clipboard Icon */
    NSString *ClipboardB64 = @"";
    NSData *ClipboardImageData = [[NSData alloc] initWithBase64EncodedString:ClipboardB64 options:NSDataBase64DecodingIgnoreUnknownCharacters];
    UIImage *ClipboardUIImage = [UIImage imageWithData:ClipboardImageData];
    
    /* Globe Icon */
    NSString *GlobeB64 = @"";
    NSData *GlobeImageData = [[NSData alloc] initWithBase64EncodedString:GlobeB64 options:NSDataBase64DecodingIgnoreUnknownCharacters];
    UIImage *GlobeUIImage = [UIImage imageWithData:GlobeImageData];
    
    //Chat base64 image representations
    NSString* GlobalChat = @"";
    NSString* LocalChat = @"";
    NSString* TribeChat = @"";
    NSString* AllyChat = @"";
    
    //Chat image datas
    NSData *GlobalChatImageData = [[NSData alloc] initWithBase64EncodedString:GlobalChat options:NSDataBase64DecodingIgnoreUnknownCharacters];
    NSData *LocalChatImageData = [[NSData alloc] initWithBase64EncodedString:LocalChat options:NSDataBase64DecodingIgnoreUnknownCharacters];
    NSData *TribeChatImageData = [[NSData alloc] initWithBase64EncodedString:TribeChat options:NSDataBase64DecodingIgnoreUnknownCharacters];
    NSData *AllyChatImageData = [[NSData alloc] initWithBase64EncodedString:AllyChat options:NSDataBase64DecodingIgnoreUnknownCharacters];
    
    //Chat images
    UIImage *GlobalChatUIImage = [UIImage imageWithData:GlobalChatImageData];
    UIImage *LocalChatUIImage = [UIImage imageWithData:LocalChatImageData];
    UIImage *TribeChatUIImage = [UIImage imageWithData:TribeChatImageData];
    UIImage *AllyChatUIImage = [UIImage imageWithData:AllyChatImageData];

    int IconIndex = 0;
    
    for(int i = 0; i<EntriesSize; i++){
        //get the current chat entry to add
        TextEntries CurrentEntry = entries[i];
        
        //init the new entry backround
        UIView* TextEntry = [[UIView alloc] initWithFrame:CGRectMake(HorizontalSpacing/2, VerticalHeight, UIScreen.mainScreen.bounds.size.width - HorizontalSpacing, EntryHeight)];
        [TextEntry setBackgroundColor:[UIColor lightGrayColor]];
        TextEntry.alpha = .7f;
        TextEntry.layer.cornerRadius = 20;
        [TextEntry setUserInteractionEnabled:NO];
        
        // Add Chat Icon to the left of the text
        UIImageView* iconImage = [[UIImageView alloc]initWithFrame:CGRectMake(10, 10, 80, 80)];
        iconImage.layer.cornerRadius = 10;
        iconImage.layer.masksToBounds = YES;
        
        //change the icon depending apon chat channel
        if(CurrentEntry.Channel == Local) {
            iconImage.image = LocalChatUIImage;
        } else if(CurrentEntry.Channel == Global) {
            iconImage.image = GlobalChatUIImage;
        } else if(CurrentEntry.Channel == Tribe) {
            iconImage.image = TribeChatUIImage;
        } else if(CurrentEntry.Channel == TribeAndAlliance) {
            iconImage.image = AllyChatUIImage;
        } else if(CurrentEntry.Channel == Radio) {
            iconImage.image = LocalChatUIImage;
        } else {
            iconImage.image = GlobalChatUIImage;
        }
        
        [TextEntry addSubview:iconImage];
        
        /* Add name text Layer */
        UILabel* TextLabel = [[UILabel alloc]initWithFrame:CGRectMake(120, 10, Screen_Width-140, 20)];
        TextLabel.text = CurrentEntry.PlayerName;
        
        if(CurrentEntry.TeamID == Enemy){
            TextLabel.textColor = [UIColor redColor];
        } else if(CurrentEntry.TeamID == Tribemate){
            TextLabel.textColor = [UIColor colorWithRed:0 green:0.4 blue:0 alpha:1];
        } else if(CurrentEntry.TeamID == Ally){
            TextLabel.textColor = [UIColor blueColor];
        } else {
            TextLabel.textColor = [UIColor blackColor];
        }
        
        TextLabel.font = [UIFont fontWithName:@"Copperplate-Bold" size:25];
        TextLabel.adjustsFontSizeToFitWidth = true;
        [TextEntry addSubview:TextLabel];
        
        /* Add the translated Text*/
        TextLabels[IconIndex] = [[UILabel alloc]initWithFrame:CGRectMake(125, 30, Screen_Width-160, 60)];
        TextLabels[IconIndex].text = CurrentEntry.TextString;
        TextLabels[IconIndex].textColor = [UIColor blackColor];
        TextLabels[IconIndex].font = [UIFont fontWithName:@"Copperplate-Bold" size:16];
        TextLabels[IconIndex].adjustsFontSizeToFitWidth = true;
        TextLabels[IconIndex].numberOfLines = 0;
        TextLabels[IconIndex].lineBreakMode = NSLineBreakByWordWrapping;
        [TextEntry addSubview: TextLabels[IconIndex]];
        
        /* Add Globe view to the backround so it can be tapped even though the entry backround is not interactable */
        GlobeViews[IconIndex] = [[UIView alloc] initWithFrame:CGRectMake(HorizontalSpacing/2 + Screen_Width-60,
                                                                         VerticalHeight + 10, 25, 25)];
        [GlobeViews[IconIndex] setBackgroundColor:[UIColor clearColor]];
        GlobeViews[IconIndex].alpha = 0.8f;
        GlobeViews[IconIndex].layer.cornerRadius = 20;
        [GlobeViews[IconIndex] setUserInteractionEnabled:YES];
        [GlobeViews[IconIndex] setTag:IconIndex];

        //add the globe image and the action for when it is tapped
        UIImageView* GlobeImageView = [[UIImageView alloc] initWithFrame:CGRectMake(0, 0, 25, 25)];
        GlobeImageView.image = GlobeUIImage;
        [GlobeViews[IconIndex] addSubview:GlobeImageView];
        UIButton *TextTranslateButotn = [UIButton buttonWithType:UIButtonTypeCustom];
        [TextTranslateButotn setTag:IconIndex];
        TextTranslateButotn.frame = CGRectMake(0, 0, 25, 25);
        
        [TextTranslateButotn addTarget:self action:@selector(TranslationButtonPressed:)
                     forControlEvents:UIControlEventTouchUpInside];
        
        [GlobeViews[IconIndex] addSubview:TextTranslateButotn];
        
        
        // add the view for the copy button, which can be interacted with
        CopyViews[IconIndex] = [[UIView alloc] initWithFrame:CGRectMake(HorizontalSpacing/2 + Screen_Width-60, VerticalHeight + 60, 25, 25)];
        [CopyViews[IconIndex] setBackgroundColor:[UIColor clearColor]];
        CopyViews[IconIndex].alpha = 0.8f;
        CopyViews[IconIndex].layer.cornerRadius = 20;
        [CopyViews[IconIndex] setUserInteractionEnabled:YES];
        [CopyViews[IconIndex] setTag:IconIndex];

        //add the icon for the clipboard
        UIImageView* ClipboardImageView = [[UIImageView alloc] initWithFrame:CGRectMake(0, 0, 25, 25)];
        ClipboardImageView.image = ClipboardUIImage;
        [CopyViews[IconIndex] addSubview:ClipboardImageView];
        
        UIButton *ClipboardButton = [UIButton buttonWithType:UIButtonTypeCustom];
        [ClipboardButton setTag:IconIndex];
        ClipboardButton.frame = CGRectMake(0, 0, 25, 25);
        [ClipboardButton addTarget:self action:@selector(CopyText:) forControlEvents:UIControlEventTouchUpInside];
        [CopyViews[IconIndex] addSubview:ClipboardButton];
        
        
        

        [view addSubview:TextEntry];
        [view addSubview:GlobeViews[IconIndex]];
        [view addSubview:CopyViews[IconIndex]];
        VerticalHeight += EntryHeight + VericalSpacing;
        IconIndex++;
    }
}

- (void)SelectLanguage {
        UIAlertController *alertController = [UIAlertController alertControllerWithTitle:@"Choose Language"
                                                                                 message:@"Choose the Language to Translate to"
                                                                          preferredStyle:UIAlertControllerStyleActionSheet];
        //Add the cancel action
        UIAlertAction *cancel = [UIAlertAction actionWithTitle:@"Cancel" style:UIAlertActionStyleCancel handler:^(UIAlertAction * _Nonnull action) {}];
        
        //Add the language options
        UIAlertAction *English = [UIAlertAction actionWithTitle:@"English" style:UIAlertActionStyleDefault handler:^(UIAlertAction * _Nonnull action) {
            CurrentLanguage.text = @"English";
            TranslateToLanguage = @"en";
        }];
        UIAlertAction *Spanish = [UIAlertAction actionWithTitle:@"Espanol" style:UIAlertActionStyleDefault handler:^(UIAlertAction * _Nonnull action) {
            CurrentLanguage.text = @"Espanol";
            TranslateToLanguage = @"es";
        }];
        UIAlertAction *Chinese = [UIAlertAction actionWithTitle:@"中文" style:UIAlertActionStyleDefault handler:^(UIAlertAction * _Nonnull action) {
            CurrentLanguage.text = @"中文";
            TranslateToLanguage = @"zh";
        }];
        UIAlertAction *Korean = [UIAlertAction actionWithTitle:@"한국인" style:UIAlertActionStyleDefault handler:^(UIAlertAction * _Nonnull action) {
            CurrentLanguage.text = @"한국인";
            TranslateToLanguage = @"ko";
        }];
        UIAlertAction *Japenese = [UIAlertAction actionWithTitle:@"日本人" style:UIAlertActionStyleDefault handler:^(UIAlertAction * _Nonnull action) {
            CurrentLanguage.text = @"日本人";
            TranslateToLanguage = @"ja";
        }];
        UIAlertAction *Turkish = [UIAlertAction actionWithTitle:@"Türk" style:UIAlertActionStyleDefault handler:^(UIAlertAction * _Nonnull action) {
            CurrentLanguage.text = @"Türk";
            TranslateToLanguage = @"tr";
        }];

        // Add the actions to the alert controller
        [alertController addAction:cancel];
        [alertController addAction:English];
        [alertController addAction:Spanish];
        [alertController addAction:Chinese];
        [alertController addAction:Korean];
        [alertController addAction:Japenese];
        [alertController addAction:Turkish];
        

        // Present the alert controller
        [self presentViewController:alertController animated:YES completion:nil];
}

- (void)HideWindow{
    //Handle Closing Window
}
- (void)CopyTextToClipboard:(NSString *)Text{
    UIPasteboard *pb = [UIPasteboard generalPasteboard];
    [pb setString:Text];
    UIAlertController *alertController = [UIAlertController alertControllerWithTitle:@"Copied to Clipboard"
                                                                             message:[NSString stringWithFormat:@"Translation: %@", Text]
                                                                      preferredStyle:UIAlertControllerStyleActionSheet];

    UIAlertAction *cancel = [UIAlertAction actionWithTitle:@"Okay" style:UIAlertActionStyleCancel handler:^(UIAlertAction * _Nonnull action) {}];

    [alertController addAction:cancel];
    
    [self presentViewController:alertController animated:YES completion:nil];
}


- (void)FinishTranslation:(NSString *)Text{
    [self CopyTextToClipboard:Text];
}
- (void)TranslateTextTo:(NSString *)Text Language:(NSString *)Language{
    NSString *allowedInput = [Text stringByAddingPercentEncodingWithAllowedCharacters:[NSCharacterSet URLQueryAllowedCharacterSet]];
    NSString *urlString = [NSString stringWithFormat:@"https://translation.googleapis.com/language/translate/v2?key=%@&q=%@&target=%@&format=text&auto=detect",keyAPI, allowedInput, Language];
    NSURL *url = [NSURL URLWithString:urlString];
    NSMutableURLRequest *request = [NSMutableURLRequest requestWithURL:url];
    request.HTTPMethod = @"POST";

    [[[NSURLSession sharedSession] dataTaskWithRequest:request completionHandler:^(NSData *data, NSURLResponse *response, NSError *error) {

        if (!error) {

            NSDictionary *answer = [NSJSONSerialization JSONObjectWithData:data options:NSJSONReadingAllowFragments error:nil];

            NSLog(@"Translated Text: %@", answer[@"data"][@"translations"][0][@"translatedText"]);
            dispatch_after(dispatch_time(DISPATCH_TIME_NOW, 0.01 * NSEC_PER_SEC), dispatch_get_main_queue(), ^{
                [self CopyTextToClipboard:answer[@"data"][@"translations"][0][@"translatedText"]];
            });
        }

    }] resume];
}
- (void)ChooseTranslateLanguage:(NSString *)Text{
    UIAlertController *alertController = [UIAlertController alertControllerWithTitle:@"Choose Language"
                                                                             message:@"Choose the Language to Translate to"
                                                                      preferredStyle:UIAlertControllerStyleActionSheet];

    UIAlertAction *cancel = [UIAlertAction actionWithTitle:@"Cancel" style:UIAlertActionStyleCancel handler:^(UIAlertAction * _Nonnull action) {}];

    UIAlertAction *English = [UIAlertAction actionWithTitle:@"English" style:UIAlertActionStyleDefault handler:^(UIAlertAction * _Nonnull action) { // Handle the emote action
        LanguageToTranslateTo = @"en";
        [self TranslateTextTo:Text Language:LanguageToTranslateTo];
    }];
    UIAlertAction *Spanish = [UIAlertAction actionWithTitle:@"Espanol" style:UIAlertActionStyleDefault handler:^(UIAlertAction * _Nonnull action) { // Handle the emote action
        LanguageToTranslateTo = @"es";
        [self TranslateTextTo:Text Language:LanguageToTranslateTo];
    }];
    UIAlertAction *Chinese = [UIAlertAction actionWithTitle:@"中文" style:UIAlertActionStyleDefault handler:^(UIAlertAction * _Nonnull action) { // Handle the emote action
        LanguageToTranslateTo = @"zh";
        [self TranslateTextTo:Text Language:LanguageToTranslateTo];
    }];
    UIAlertAction *Korean = [UIAlertAction actionWithTitle:@"한국인" style:UIAlertActionStyleDefault handler:^(UIAlertAction * _Nonnull action) { // Handle the emote action
        LanguageToTranslateTo = @"ko";
        [self TranslateTextTo:Text Language:LanguageToTranslateTo];
    }];
    UIAlertAction *Japenese = [UIAlertAction actionWithTitle:@"日本人" style:UIAlertActionStyleDefault handler:^(UIAlertAction * _Nonnull action) { // Handle the emote action
        LanguageToTranslateTo = @"ja";
        [self TranslateTextTo:Text Language:LanguageToTranslateTo];
    }];
    UIAlertAction *Turkish = [UIAlertAction actionWithTitle:@"Türk" style:UIAlertActionStyleDefault handler:^(UIAlertAction * _Nonnull action) { // Handle the emote action
        LanguageToTranslateTo = @"tr";
        [self TranslateTextTo:Text Language:LanguageToTranslateTo];
    }];

    // Add the actions to the alert controller
    [alertController addAction:cancel];
    [alertController addAction:English];
    [alertController addAction:Spanish];
    [alertController addAction:Chinese];
    [alertController addAction:Korean];
    [alertController addAction:Japenese];
    [alertController addAction:Turkish];
    

    // Present the alert controller
    [self presentViewController:alertController animated:YES completion:nil];
}
- (void)TranslateMyText {
 
    UIAlertController *alertController = [UIAlertController alertControllerWithTitle:@"Send the Message"
                                                                             message:@"Type what you wana translate"
                                                                      preferredStyle:UIAlertControllerStyleAlert];

    UIAlertAction *cancelAction = [UIAlertAction actionWithTitle:@"Cancel" style:UIAlertActionStyleCancel handler:^(UIAlertAction * _Nonnull action) {}];

    UIAlertAction *Translate = [UIAlertAction actionWithTitle:@"Translate" style:UIAlertActionStyleDefault handler:^(UIAlertAction * _Nonnull action) { // Handle the emote action
        NSString *text = [[alertController.textFields objectAtIndex:0] text];
        NSLog(text);
        [self ChooseTranslateLanguage:text];
    }];
    [alertController addTextFieldWithConfigurationHandler:^(UITextField *textField) {
        textField.placeholder = @"Placeholder text";
    }];

    // Add the actions to the alert controller
    [alertController addAction:Translate];
    [alertController addAction:cancelAction];

    // Present the alert controller
    [self presentViewController:alertController animated:YES completion:nil];
}
- (void)TranslationButtonPressed:(UIButton *)sender{
    [self DetectLang:(int)[sender tag] Text:TextLabels[[sender tag]].text];

}
- (void)CopyText:(UIButton *)sender {
    
    [self CopyTextToClipboard:TextLabels[[sender tag]].text];
    NSLog(@"Copied to Cliboard: %@", TextLabels[[sender tag]].text);
}

- (void)DetectLang:(int)Index Text:(NSString*)Text{
    NSString *allowedInput = [Text stringByAddingPercentEncodingWithAllowedCharacters:[NSCharacterSet URLQueryAllowedCharacterSet]];
    NSString *urlString = [NSString stringWithFormat:@"https://translation.googleapis.com/language/translate/v2?key=%@&q=%@&target=%@&format=text&auto=detect",keyAPI, allowedInput, TranslateToLanguage];
    NSURL *url = [NSURL URLWithString:urlString];
    NSMutableURLRequest *request = [NSMutableURLRequest requestWithURL:url];
    request.HTTPMethod = @"POST";

    [[[NSURLSession sharedSession] dataTaskWithRequest:request completionHandler:^(NSData *data, NSURLResponse *response, NSError *error) {

        if (!error) {

            NSDictionary *answer = [NSJSONSerialization JSONObjectWithData:data options:NSJSONReadingAllowFragments error:nil];

            NSLog(@"Translated Text: %@", answer[@"data"][@"translations"][0][@"translatedText"]);
            dispatch_after(dispatch_time(DISPATCH_TIME_NOW, 0.01 * NSEC_PER_SEC), dispatch_get_main_queue(), ^{
                TextLabels[Index].text = answer[@"data"][@"translations"][0][@"translatedText"];
            });
        }

    }] resume];
}


@end
